import base64
from io import BytesIO
from PIL import Image
import numpy as np
import cv2
def base64_pil(base64_str):
  image = base64.b64decode(base64_str)
  image = BytesIO(image)
  image = Image.open(image)
  image.show()
  print("success!")
  image.save("input_b64.jpg")


